INSERT INTO `halaman` (`id`, `seo`, `judul`, `keterangan`, `gambar`, `aktif`, `created_at`, `updated_at`) VALUES
(1, 'tentang-kami', 'Tentang Kami', '<p><strong>Daarul Mukhtarin: Tempat Tumbuhnya Generasi Qurani dan Ulama Masa Depan</strong></p><p>Pesantren Daarul Mukhtarin adalah sebuah lembaga pendidikan Islam yang memadukan tradisi keilmuan klasik dengan semangat pembelajaran modern. Terletak di lingkungan yang asri dan tenang, pesantren ini menjadi tempat ideal bagi para santri untuk mendalami ilmu agama, memperkuat keimanan, dan membangun karakter Islami.</p><p>Pesantren ini menawarkan dua jurusan utama yang menjadi kebanggaannya: <strong>Jurusan Kitab</strong> dan <strong>Jurusan Tahfidz</strong>.</p><h3><strong>Jurusan Kitab</strong></h3><p>Jurusan Kitab dirancang untuk mencetak santri yang mampu memahami, mengkaji, dan mengamalkan khazanah keilmuan Islam dari kitab-kitab klasik yang menjadi rujukan ulama. Dengan bimbingan para ustaz dan kiai yang ahli di bidangnya, santri diajak untuk mendalami berbagai disiplin ilmu seperti fikih, tafsir, hadis, tasawuf, dan ushul fiqh. Metode pembelajaran yang mendalam dan terstruktur memastikan para santri tidak hanya memahami teks, tetapi juga mampu menerapkannya dalam kehidupan sehari-hari.</p><h3><strong>Jurusan Tahfidz</strong></h3><p>Bagi mereka yang bercita-cita menjadi penghafal Al-Qur\'an, Jurusan Tahfidz di Daarul Mukhtarin adalah pilihan yang tepat. Dengan program yang terarah, para santri akan dibimbing untuk menghafal Al-Qur\'an 30 juz secara bertahap dan terencana. Selain menghafal, santri juga diajarkan tajwid, tahsin, dan tafsir untuk memperkuat pemahaman dan pengamalan mereka terhadap Al-Qur\'an. Lingkungan pesantren yang penuh keberkahan menjadikan proses menghafal lebih khusyuk dan bermakna.</p><h3><strong>Keunggulan Pesantren Daarul Mukhtarin</strong></h3><ol><li><strong>Lingkungan Islami</strong>: Suasana pesantren yang kondusif dan penuh ketenangan mendukung perkembangan spiritual dan intelektual santri.</li><li><strong>Pengajar Berkompeten</strong>: Diasuh oleh para kiai, ustaz, dan pengajar berpengalaman yang berdedikasi tinggi.</li><li><strong>Fasilitas Lengkap</strong>: Tersedia masjid, ruang belajar, perpustakaan, dan asrama yang nyaman untuk menunjang aktivitas belajar.</li><li><strong>Pendidikan Karakter</strong>: Selain ilmu, santri diajarkan adab, akhlak mulia, dan kedisiplinan sebagai bekal kehidupan.</li><li><strong>Pengembangan Diri</strong>: Kegiatan ekstrakurikuler seperti diskusi kitab, seni kaligrafi, dan olahraga membantu santri berkembang secara holistik.</li></ol><h3><strong>Komitmen Daarul Mukhtarin</strong></h3><p>Pesantren Daarul Mukhtarin berdedikasi untuk melahirkan generasi Qurani yang cerdas, berakhlak mulia, dan siap memberikan kontribusi nyata bagi masyarakat. Di sini, santri tidak hanya belajar untuk dunia, tetapi juga mempersiapkan bekal untuk kehidupan akhirat.</p><p>Bergabunglah bersama kami dan jadilah bagian dari perjalanan menuju masa depan yang penuh keberkahan!</p>', '1751550945_IMG-20241124-WA0070.jpg', 'Y', '2024-12-23 08:59:25', '2025-07-03 06:55:45'),
(2, 'hubungi-kami', 'Hubungi Kami', '<h3><span style=\"font-size: 18px;\">Kami selalu siap membantu Anda! Jika Anda memiliki pertanyaan, membutuhkan bantuan, atau ingin memberikan masukan, jangan ragu untuk menghubungi kami melalui saluran berikut:</span></h3><ul><li><strong><span style=\"font-size: 18px;\">Email:</span></strong><span style=\"font-size: 18px;\">&nbsp;</span><span style=\"font-size: 18px; line-height: 107%; font-family: Calibri, sans-serif;\">pondokpesantrendaarulmukhtarin@gmail.com</span></li><li><strong><span style=\"font-size: 18px;\">Telepon:</span></strong><span style=\"font-size: 14px;\"><span style=\"font-size: 18px;\">&nbsp;</span><span style=\"font-size: 18px;\">DM 1 (putri) : 0822-4981-7944. DM 2 (putra) : 0822-4981-7885</span></span></li><li><strong><span style=\"font-size: 18px;\">Alamat:</span></strong><span style=\"font-size: 18px;\"> </span><span lang=\"IN\" style=\"font-size: 18px; line-height: 107%; font-family: Calibri, sans-serif;\">Jl. KH, Moh.Dahlan Kp.Nunut RT.05/02 Ds.Tanjakan Mekar\r\nKec.Rajeg Tangerang-Banten</span></li></ul><h3><strong>Pusat Bantuan</strong></h3><ul><li><p><strong><span style=\"font-size: 18px;\">Jam Operasional:</span></strong><br><span style=\"font-size: 18px;\">Senin - Minggu: 07.00 - 21.00 WIB</span><br></p></li></ul>', '1735613616_hubungi-kami.jpg', 'Y', '2024-12-30 19:53:36', '2025-07-03 07:03:34');
